import React from 'react';
import './Navigation.css';

function Navigation() {
    return (
        <ul>
            <li><a href="www.google.com">Google</a></li>
            <li><a href="www.yahoo.com">Yahoo</a></li>
        </ul>
    );
}

export default Navigation;
